export const Icons = {
    responsive_main: `data:image/png;base64,`,
    trashbin: `data:image/png;base64,`,
    arrow_left: `data:image/png;base64,`,
    arrow_right: `data:image/png;base64,`,
    arrow_up: `data:image/png;base64,`,
    arrow_down: `data:image/png;base64,`,
    gesture: `data:image/png;base64,`,
    chat: `data:image/png;base64,`,
    github: `data:image/png;base64,`
};

let ImageStorage: Map<keyof typeof Icons, HTMLImageElement> = new Map();

export function GetIcon(tag: keyof typeof Icons) {
    let img = ImageStorage.get(tag);
    if (!img) {
        img = new Image();
        img.src = Icons[tag];
        ImageStorage.set(tag, img);
    }
    return img;
}